import intern from "./internship.json";

const Internship = () => {
	//console.log(intern.map(i => i.Company))

    return <>
        {
            intern.map((i, index) => (
                <div key={index}>
					<h2>Internship Experience</h2>
					<h4>{i.Role}</h4>
                    <h4>{i.Company + " | " + i.Location + " | " + i.Time}</h4>
					<ul>
						<li>{i.Description[index]}</li>
						<li>{i.Description[index]}</li>
					</ul>
                </div>
            ))
        }
    </>
}

export default Internship
